import breakingBad from "../data/breakingBad.jpeg";
import { Link } from "react-router-dom";

const Welcome = () => {
  return (
    <div>
      <h1>Welcome To...</h1>
      <img src={breakingBad} alt="breaking bad" style={{ width: "100%" }} />

    <div style={{padding: "5%"}}>
      <div style={{marginBottom: "15px", border: "1px solid white" }}>
        <Link
          to="/characters"
          style={{
            color: "white",
            textDecoration: "none",
            margin: "auto",
            padding: 0,
            textAlign: "center",
            display: "grid", 
            gridTemplateColumns: "1fr 1fr",
          }}
        >
          <h3 style={{margin: "auto"}}>View Breaking Bad characters</h3>
          <img src={"https://static1.srcdn.com/wordpress/wp-content/uploads/2020/08/Better-Call-Saul-Every-Major-Breaking-Bad-Character-Still-Missing.jpg"} alt="breaking bad" style={{ width: "100%" }} />
        </Link>
      </div>

      <div style={{ display: "grid", gridTemplateColumns: "1fr 1fr", border: "1px solid white" }}>
        <img src={"https://i.pinimg.com/originals/70/df/18/70df18ff5cdddbe6250ac59de634b183.jpg"} alt="breaking bad quotes" style={{ width: "100%" }} />
        <Link
          to="/characters"
          style={{
            color: "white",
            textDecoration: "none",
            margin: "auto",
            padding: 0,
            textAlign: "center"
          }}
        >
          <h3>Read Breaking Bad Quotes</h3>
        </Link>
      </div>
      </div>
    </div>
  );
};

export default Welcome;
